import skydive from '../assets/002.jpg';
import cave from '../assets/003.jpg'
import scene1 from '../assets/004.jpg';
import ScrollableAnchor from 'react-scrollable-anchor';
import { HRAbout } from './HRAbout';

export const HRLanding = () => {
    return (
        <div>


            <HRHeader />
            <NavRow />
